var longestCommonSubsequence = function (text1, text2) {
  return helper(text1, text2, memo = {});
};

function helper(text1, text2, memo) {
  const key = text1 + ',' + text2;
  if (key in memo) {
    console.log('Memo found ', text1, text2, memo[key]);
    return memo[key]
  };

  if (text1 === '' || text2 === '') return 0;

  if (text1.charAt(0) === text2.charAt(0)) {
    memo[key] = 1 + helper(text1.slice(1), text2.slice(1), memo);
  } else {
    memo[key] = Math.max(
      helper(text1.slice(1), text2, memo),
      helper(text1, text2.slice(1), memo),
    )
  }

  return memo[key];
}

const text1 = "";
const text2 = "";


var longestCommonDP = function (text1, text2) {
  const dp = Array(text1.length + 1).fill()
    .map(() => Array(text2.length + 1).fill(0));

  for (let i = text1.length - 1; i >= 0; i--) {
    for (let j = text2.length - 1; j >= 0; j--) {
      if (text1.charAt(i) === text2.charAt(j)) {
        dp[i][j] = 1 + dp[i + 1][j + 1];
      } else {
        dp[i][j] = Math.max(dp[i + 1][j], dp[i][j + 1]);
      }
    }
  }

  return dp[0][0];
};


